// Define API configuration first
const apiConfig = {
  request: {
    get: "GET",
    post: "POST",
    put: "PUT",
    patch: "PATCH",
    delete: "DELETE",
  },
  CountryCodes_API: {
    end_point:
      "https://mobile-services-92086589662.us-central1.run.app/CountryCodes",
    body: {
      user: "Admin",
      password: "GenAI@7070",
      token: "GenAI-CountryCodes",
    },
  },
  Query_API: {
    end_point:
      "https://query-services-92086589662.us-central1.run.app/UserQuery",
    body: {
      user: "Admin",
      password: "GenAI@7070",
      token: "GenAI-QueryData",
    },
  },
};
export const createAuthConfig = (apiName, data) => {
  return {
    url: `${BASEURL}/${apiName}`,
    method: "post",
    data,
  };
};

export const signupApi = async (data) => {
  const apiName = "signup";
  const config = await createAuthConfig(apiName, data);
  try {
    const response = await axios(config);
    return response.data;
  } catch (error) {
    console.log("error", error);
    throw error;
  }
};
